import {useState, useEffect} from 'react'

const ItemDetail = ({id}) => {

  const [data, setData] = useState([])

  const getItemById = async () => {
    const url = `http://localhost:3000/items/${id}`
    const data = await fetch(url)
      .then(res => res.json())
      .then(data => data)
      .catch(err => err)
      return data;
  }

  useEffect(() => {
    getItemById().then(data => console.log(data)).catch(err => console.log(err))
  }, [])


  return (
    <div>
      Estoy en item detail {id}
      {data.name}
    </div>
  )
}

export default ItemDetail
